import React, { useState } from 'react';
import UsuarioService from '../services/UsuarioService';
import Swal from 'sweetalert2';

const ChangePassword = () => {
    const [password, setPassword] = useState('');
    const [error, setError] = useState('');

    const handleChangePassword = async () => {
        const token = localStorage.getItem('token');
        const userId = "ejemploId"; // Reemplaza esto con la lógica real para obtener el ID del usuario

        try {
            const response = await UsuarioService.changePassword(userId, { password }, token);
            Swal.fire("Éxito", "Contraseña cambiada correctamente.", "success");
        } catch (error) {
            console.error("Error al cambiar la contraseña:", error);
            setError("Error al cambiar la contraseña."); // Manejo de errores
        }
    };

    return (
        <div>
            <h1>Cambiar Contraseña</h1>
            <input 
                type="password" 
                value={password} 
                onChange={(e) => setPassword(e.target.value)} 
                placeholder="Nueva Contraseña" 
            />
            <button onClick={handleChangePassword}>Cambiar Contraseña</button>
            {error && <div className="alert alert-danger">{error}</div>}
        </div>
    );
};

export default ChangePassword;
